import React, { Component } from 'react'
import '../style/Header.css'
import sobre from './About'

export default class Header extends Component {
  render() {
    return (
      <header>
        <div>
          <h3>Caroline Nunes</h3>
        </div>
        <nav>
          <ul>
            <li><a href={sobre}>Sobre</a></li>
          </ul>
        </nav>

      </header>
    )
  }
}
